import { createRouter, createWebHistory } from 'vue-router';
import register from '@/views/RegisterForm.vue';
import login from '@/views/LoginForm.vue';
import home from '@/views/Home.vue';
import session_routes from './session_routes';
import DashBoard from '@/views/DashBoard.vue';
import UpdateUser from "@/views/UpdateUser.vue"
import ListTemplates from "@/views/ListTemplates.vue"
import CreateResults from "@/views/CreateResults.vue"
import DiagnosticoController from "@/views/DiagnosticoController.vue"
const routes = [

  {
    path: '/register',
    name: 'Register',
    component: register,
    meta: {
      auth:true
    }
  
  },
  {
    path: '/login',
    name: 'Login',
    component: login,
  },
  {
    path: '/',
    name: 'Home',
    component: home
  },
  {
    path:'/dashboard',
    name:'Dashboard',
    component: DashBoard,
    meta: {
      auth:true
    }
  },
  {
    path:'/update',
    name:'Update',
    component: UpdateUser,
    meta: {
      auth:true
    }
  },
  {
    path:'/templates',
    name:'Templates',
    component: ListTemplates,
    meta: {
      auth:true
    }
  },
  {
    path:"/createresults",
    name: "CreateResults",
    component: CreateResults,
    meta: {
      auth:true
    }
  },
  {
    path:"/user/{slug}",
    name:"DiagnosticoController",
    component: DiagnosticoController,
    meta: {
      auth:true
    }
  }
  
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
});

router.beforeEach(session_routes);
export default router;
